export default {
  checkLogin,
  register: (register) => axios.post(`${baseURL}/register`, register),

  details: () => axios.get(`${baseURL}/details`, token),

  logout: () => axios.get(`${baseURL}/logout`, token),

  createPost: (post) => axios.post(`${baseURL}/unicorns`, post, token),
};
